import React from "react";
import MidleContainerStyle from "./MidleContainerStyle"

import MidleContentStyle from "./MidleContentStyle"

class MidleContent extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
        };
      }


      render() {
        return (
            <MidleContentStyle>
                <h3>MidleContent</h3>
            </MidleContentStyle>
        )
      }
}


export default MidleContent;
